function [R1, R2, R3, R4, R5] = soal(f, X)  E = [1*10^-4, 1*10^-6, 1*10^-8, 1*10^-10, 1*10^-12];  R1 = zeros(5,4); R2 = zeros(5,4); R3 = zeros(5,4); R4 = zeros(5,4); R5 = zeros(5,4);    for i=1:5    tic;    [res, iter] = mod_newton_solver(f, E(i), X(1)); error = feval(f, res);    time = toc;    R1(i,1:4) = [res, iter, error, time];  endfor    for i=1:5    tic;    [res, iter] = mod_newton_solver(f, E(i), X(2)); error = feval(f, res);    time = toc;    R2(i,1:4) = [res, iter, error, time];  endfor  for i=1:5    tic;    [res, iter] = mod_newton_solver(f, E(i), X(3)); error = feval(f, res);    time = toc;    R3(i,1:4) = [res, iter, error, time];  endfor  for i=1:5    tic;    [res, iter] = mod_newton_solver(f, E(i), X(4)); error = feval(f, res);    time = toc;    R4(i,1:4) = [res, iter, error, time];  endfor    for i=1:5    tic;    [res, iter] = mod_newton_solver(f, E(i), X(5)); error = feval(f, res);    time = toc;    R5(i,1:4) = [res, iter, error, time];  endforendfunction